pragma solidity ^0.6.0;

import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/access/Ownable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/ERC20Burnable.sol";

interface IERC20Burnable {
    function burnFrom(address account, uint256 amount) external;
}

/**
* @dev This contract will hold user locked funds which will be unlocked after
* lock-up period ends
*/
contract SwapLock is Initializable, OwnableUpgradeSafe, PausableUpgradeSafe {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    enum Status { _, OPEN, CLOSED }

    IERC20 private _swapToken;

    //Wallet where fees will go
    address payable private _feesWallet;

    //Wallet where dev fund will go
    address private _devWallet;

    address constant private ETH_ADDRESS = address(
        0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE
    );

    struct Payment {
        address token;// Token address
        uint256 amount;// Amount locked
        uint256 releaseTime;
        uint256 lastLocked;
        address payable beneficiary;// Beneficary who will receive funds
        Status status;
    }

    //Global lockedasset id. Also give total number of lock-ups made so far
    uint256 private _paymentId;

    //list of all asset ids for a user/beneficiary
    mapping(address => uint256[]) private _userVsPaymentIds;

    mapping(uint256 => Payment) private _idVsPayment;

    event FeeWalletChanged(address indexed wallet);
    event DevWalletChanged(address indexed wallet);

    event PaymentScheduled(
        address indexed token,
        address indexed sender,
        address indexed beneficiary,
        uint256 id,
        uint256 amount,
        uint256 releaseTime,
        bool swapTokenFee,
        uint256 fee
    );
    event PaymentReleased(
        uint256 indexed id,
        address indexed beneficiary,
        address indexed token
    );

    event SwapTokenUpdated(address indexed swapTokenAddress);
    event SwapTokenFeeUpdated(uint256 fee);

    event AmountAdded(address indexed beneficiary, uint256 id, uint256 amount);

    modifier canClaim(uint256 id) {
        require(claimable(id), "SwapLock: Can't claim asset");
        _;
    }

    /**
    * @dev initialize
    * @param swapTokenAddress Address of the swap token
    * @param feesWallet Wallet address where fees will go
    * @param devWallet Wallet address where dev fund will go
    */
    function initialize(address swapTokenAddress, address payable feesWallet, address devWallet)
    public
    {
        __SwapLock_init(swapTokenAddress, feesWallet, devWallet);
    }

    function __SwapLock_init(address swapTokenAddress, address payable feesWallet, address devWallet)
    internal
    initializer
    {
        __Context_init_unchained();
        __Ownable_init_unchained();
        __Pausable_init_unchained();
        __SwapLock_init_unchained(swapTokenAddress, feesWallet, devWallet);
    }

    function __SwapLock_init_unchained(address swapTokenAddress, address payable feesWallet, address devWallet)
    internal
    initializer
    {
        require(swapTokenAddress != address(0), "SwapLock: Invalid swap token address");
        require(feesWallet != address(0), "SwapLock: Please provide valid feesWallet address!!");
        _swapToken = IERC20(swapTokenAddress);
        _feesWallet = feesWallet;
        _devWallet = devWallet;
    }

    /**
    * @dev returns the fee receiver wallet address
    */
    function getFeesWallet() external view returns(address) {
        return _feesWallet;
    }

    /**
    * @dev returns the dev fund wallet address
    */
    function getDevWallet() external view returns(address) {
        return _devWallet;
    }

    /**
    * @dev Returns swap token address
    */
    function getSwapToken() external view returns(address) {
        return address(_swapToken);
    }

    /**
    * @dev Returns information about a locked asset
    * @param id Asset id
    */
    function getLockedAsset(uint256 id) external view returns(
        address token,
        uint256 amount,
        uint256 releaseTime,
        uint256 lastLocked,
        address beneficiary,
        Status status
    )
    {
        Payment memory asset = _idVsPayment[id];
        token = asset.token;
        amount = asset.amount;
        releaseTime = asset.releaseTime;
        beneficiary = asset.beneficiary;
        status = asset.status;
        lastLocked = asset.lastLocked;

        return(
            token,
            amount,
            releaseTime,
            lastLocked,
            beneficiary,
            status
        );
    }

    /**
    * @dev Returns all asset ids for a user
    * @param user Address of the user
    */
    function getAssetIds(address user) external view returns (uint256[] memory ids)
    {
        return _userVsPaymentIds[user];
    }

    /**
    * @dev Update swap token address
    * @param swapTokenAddress New swap token address
    */
    function updateLockToken(address swapTokenAddress) external onlyOwner {
        require(
            swapTokenAddress != address(0),
            "SwapLock: Invalid swap token address"
        );
        _swapToken = IERC20(swapTokenAddress);
        emit SwapTokenUpdated(swapTokenAddress);
    }

    /**
    * @dev Allows admin to set fee receiver wallet
    * @param wallet New wallet address
    */
    function setFeeWallet(address payable wallet) external onlyOwner {
        require(
            wallet != address(0),
            "SwapLock: Please provide valid wallet address!!"
        );
        _feesWallet = wallet;

        emit FeeWalletChanged(wallet);
    }

    /**
    * @dev Allows admin to set fee receiver wallet
    * @param wallet New wallet address
    */
    function setDevWallet(address payable wallet) external onlyOwner {
        require(
            wallet != address(0),
            "SwapLock: Please provide valid wallet address!!"
        );
        _devWallet = wallet;

        emit DevWalletChanged(wallet);
    }

    /**
    * @dev Allows user to lock asset. In case of ERC-20 token the user will
    * first have to approve the contract to spend on his/her behalf
    * @param tokenAddress Address of the token to be locked
    * @param amount Amount of tokens to lock
    * @param duration Duration for which tokens to be locked. In seconds
    * @param beneficiary Address of the beneficiary
    * @param isFeeInSwap Bool to check if fee to be paid in swap token or not
    */
    function lock(
        address tokenAddress,
        uint256 amount,
        uint256 duration,
        address payable beneficiary,
        uint256 fee,
        bool isFeeInSwap
    )
        external
        payable
        whenNotPaused
    {
        uint256 remValue = _lock(
            tokenAddress,
            amount,
            duration,
            beneficiary,
            msg.value,
            fee,
            isFeeInSwap
        );

        require(
            remValue < 10000000000,
            "SwapLock: Sent more ethers then required"
        );

    }

    /**
    * @dev Helper method to lock asset
    */
    function _lock(
        address tokenAddress,
        uint256 amount,
        uint256 duration,
        address payable beneficiary,
        uint256 value,
        uint256 fee,
        bool isFeeInSwap
    )
        private
        returns(uint256)
    {
        require(beneficiary != address(0),"SwapLock: Provide valid beneficiary address!!");

        uint256 releaseTime = block.timestamp.add(duration);

        uint256 remValue = value;

        if(ETH_ADDRESS == tokenAddress) {
            _lockETH(
                amount,
                fee,
                releaseTime,
                beneficiary,
                value,
                isFeeInSwap
            );

            remValue = remValue.sub(amount).sub(fee);
        }

        else {
            _lockERC20(
                tokenAddress,
                amount,
                fee,
                releaseTime,
                beneficiary,
                isFeeInSwap
            );
        }

        emit PaymentScheduled(
            tokenAddress,
            msg.sender,
            beneficiary,
            _paymentId,
            amount,
            releaseTime,
            isFeeInSwap,
            fee
        );

        return remValue;
    }

    /**
    * @dev Helper method to lock ETH
    */
    function _lockETH(
        uint256 amount,
        uint256 fee,
        uint256 releaseTime,
        address payable beneficiary,
        uint256 value,
        bool isFeeInSwap
    )
        private
    {
        //Transferring fee to the wallet
        if(isFeeInSwap){
	        require(value >= amount, "SwapLock: Enough ETH not sent!!");
            _handleFees(fee);
        }
        else {
            require(value >= amount.add(fee), "SwapLock: Enough ETH not sent!!");
            (bool success,) = _feesWallet.call.value(fee)("");
            require(success, "SwapLock: Transfer of fee failed");
        }

        _paymentId = _paymentId.add(1);

        _idVsPayment[_paymentId] = Payment({
            token: ETH_ADDRESS,
            amount: amount,
            releaseTime: releaseTime,
            lastLocked: block.timestamp,
            beneficiary: beneficiary,
            status: Status.OPEN
        });
        _userVsPaymentIds[beneficiary].push(_paymentId);
    }

    /**
    * @dev Helper method to lock ERC-20 tokens
    */
    function _lockERC20(
        address token,
        uint256 amount,
        uint256 fee,
        uint256 releaseTime,
        address payable beneficiary,
        bool isFeeInSwap
    )
        private
    {

        //Transfer fee to the wallet
        if(isFeeInSwap){
            _handleFees(fee);
        }
        else {
            IERC20(token).safeTransferFrom(msg.sender, _feesWallet, fee);
        }

        //Transfer required amount of tokens to the contract from user balance
        IERC20(token).safeTransferFrom(msg.sender, address(this), amount);

        _paymentId = _paymentId.add(1);

        _idVsPayment[_paymentId] = Payment({
            token: token,
            amount: amount,
            releaseTime: releaseTime,
            lastLocked: block.timestamp,
            beneficiary: beneficiary,
            status: Status.OPEN
        });
        _userVsPaymentIds[beneficiary].push(_paymentId);
    }

    function _handleFees(uint256 fee) private {
        uint256 devAmount = fee.mul(10).div(100); //10%
        uint256 burnAmount = fee.mul(10).div(100); //10%
        uint256 remAmount = fee.sub(devAmount).sub(burnAmount); //80%

        _swapToken.safeTransferFrom(msg.sender, _feesWallet, remAmount);
        _swapToken.safeTransferFrom(msg.sender, _devWallet, devAmount);
        IERC20Burnable(address(_swapToken)).burnFrom(msg.sender, burnAmount);
    }

    /**
    * @dev Allows user to lock asset. In case of ERC-20 token the user will
    * first have to approve the contract to spend on his/her behalf
    * @param tokenAddress Address of the token to be locked
    * @param amounts List of amount of tokens to lock
    * @param durations List of duration for which tokens to be locked. In seconds
    * @param beneficiaries List of addresses of the beneficiaries
    * @param isFeeInSwap Bool to check if fee to be paid in swap token or not
    */
    function bulkLock(
        address tokenAddress,
        uint256[] calldata amounts,
        uint256[] calldata durations,
        address payable[] calldata beneficiaries,
        uint256[] calldata fees,
        bool isFeeInSwap
    )
        external
        payable
        whenNotPaused
    {
        uint256 remValue = msg.value;
        require(amounts.length == durations.length, "SwapLock: Invalid input");
        require(amounts.length == beneficiaries.length, "SwapLock: Invalid input");
        require(amounts.length == fees.length, "SwapLock: Invalid input");

        for(uint256 i = 0; i < amounts.length; i++){
            remValue = _lock(
                tokenAddress,
                amounts[i],
                durations[i],
                beneficiaries[i],
                remValue,
                fees[i],
                isFeeInSwap
            );
        }

        require(
            remValue < 10000000000,
            "SwapLock: Sent more ethers then required"
        );

    }

    /**
    * @dev Allows beneficiary of locked asset to claim asset after lock-up period ends
    * @param id Id of the locked asset
    */
    function claim(uint256 id) external canClaim(id) {
        Payment memory lockedAsset = _idVsPayment[id];
        if(ETH_ADDRESS == lockedAsset.token) {
            _claimETH(id);
        }
        else {
            _claimERC20(id);
        }

        emit PaymentReleased(
            id,
            lockedAsset.beneficiary,
            lockedAsset.token
        );
    }

    /**
    * @dev Returns whether given asset can be claimed or not
    * @param id id of an asset
    */
    function claimable(uint256 id) public view returns(bool){

        Payment memory asset = _idVsPayment[id];
        if( (asset.status == Status.OPEN) && (asset.releaseTime <= block.timestamp) )
        {
            return true;
        }
        return false;
    }

    /**
    * @dev Helper method to claim ETH
    */
    function _claimETH(uint256 id) private {
        Payment storage asset = _idVsPayment[id];
        asset.status = Status.CLOSED;
        (bool success,) = asset.beneficiary.call.value(asset.amount)("");
        require(success, "SwapLock: Failed to transfer eth!!");
    }

    /**
    * @dev Helper method to claim ERC-20
    */
    function _claimERC20(uint256 id) private {
        Payment storage asset = _idVsPayment[id];
        asset.status = Status.CLOSED;
        IERC20(asset.token).safeTransfer(asset.beneficiary, asset.amount);
    }

    /**
    * @dev Called by an admin to pause, triggers stopped state.
    */
    function pause() external onlyOwner {
        _pause();
    }

    /**
    * @dev Called by an admin to unpause, returns to normal state.
    */
    function unpause() external onlyOwner {
        _unpause();
    }
}

